export const styled = (theme) => ({
    root: {
        width: "100%",
    },
    backButton: {
        marginRight: theme.spacing(1),
    },
    instructions: {
        marginTop: theme.spacing(1),
        marginBottom: theme.spacing(1),
    },
    gridBooking: {
        padding: "15px",
    },
    choiceChair: {
        backgroundColor: "#6645fd",
        "&:hover": {
            backgroundColor: "#6645fd",
        },
    },
})
